            </p>
        </nav> */}

        {/* <Document
            file={`/data/${profile}/${profile}.pdf`}
            onLoadSuccess={onDocumentLoadSuccess}
        >
            <Page pageNumber={pageNumber} />
        </Document> */}
        <a href={require({mani})} download="myFile">Download file</a>
</div>
  );
